import React, { Component } from 'react';
import { Link } from "react-router-dom";

class Navegacion extends Component {
    render() {
        return (
            <div className="row justify-content-center d-flex">
                <div className="col-12 my-2 justify-content-around d-flex">
                    <nav className="pink col-12 nav ">

                        <Link to={'/inicio'}> <a className="btn btn-link text-white m-2"> Inicio </a> </Link>
                        <Link to={'/Recetas'}> <a className="btn btn-link text-white m-2"> Recetas </a></Link>
                        <Link to={'/Social'}> <a className="btn btn-link text-white m-2" > Social </a></Link>
                        <Link to={'/Preguntas'}> <a className="btn btn-link text-white m-2" >Preguntas</a> </Link>
                        <Link to={'/Magdalenas'}> <a className="btn btn-link text-white m-2" > Magdalenas  </a> </Link>
                        <Link to={'/Mousse'}> <a className="btn btn-link text-white m-2" > Mousse  </a> </Link>
                        <Link to={'/Recetas Faciles'}> <a className="btn btn-link text-white m-2"> Recetas Faciles </a> </Link>
                    </nav>
                </div>
            </div>
        )
    }
}

export default Navegacion;
